tables.table_schema:
CREATE TABLE VoterRegistration (
    registration_id INT PRIMARY KEY,
    voter_id INT REFERENCES Voter(voter_id),
    registration_date DATE NOT NULL,
    registration_status VARCHAR(20) NOT NULL
);

CREATE TABLE VoterHistory (
    history_id INT PRIMARY KEY,
    voter_id INT REFERENCES Voter(voter_id),
    change_date TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    action_taken VARCHAR(50) NOT NULL
);

CREATE TABLE voter_admin (
    id UUID PRIMARY KEY,
    voter_id UUID REFERENCES voters(id),
    access_level VARCHAR(10)
);

CREATE TABLE Voters (
    voter_id BIGINT PRIMARY KEY,
    voter_name TEXT NOT NULL,
    voter_address TEXT,
    registration_date DATE
);

CREATE TABLE VoterDetails (
    voter_id BIGINT PRIMARY KEY,
    age INT NOT NULL,
    email TEXT,
    phone_number TEXT
);

CREATE TABLE VotingHistory (
    vote_id BIGINT PRIMARY KEY,
    voter_id BIGINT NOT NULL,
    vote_date DATE,
    vote_location TEXT
);

CREATE TABLE VoterStatus (
    voter_id BIGINT PRIMARY KEY,
    is_registered BOOL NOT NULL,
    registration_status TEXT
);

CREATE TABLE VoterStats (
    voter_id BIGINT PRIMARY KEY,
    total_votes INT DEFAULT 0,
    last_vote_date DATE
);
